import React from 'react'
import {
    Form,FormGroup,Input,Button,Label
} from 'reactstrap'

export const AddVendor = () => {
    return (
        <div>
            <Form>
                <FormGroup>
                <Label>Name</Label>
                <Input type="text" placeholder="Name"></Input>
                </FormGroup>
                <Button type="submit">Submit</Button>
            </Form>
        </div>
    )
}
